import React from "react";

const Ap=()=>{
    return(
        <>
       <div className="main_div">
           <div className="center_div">
               <br/>
               <h1>Todo List</h1>
               <input type="text" placeholder="Add a Items"/>
               <button> + </button>

               <ol>
                   <li>Buy apple</li>
               </ol>
           </div>
       </div>
        </>
    );
};
export default Ap;
